comment = ""

binary = ""

for char in comment:
    if char.isupper():
        binary += "1"
    else:
        binary += "0"
    


binary_convert = int(binary,2)
byte_num = binary_convert.bit_length() + 7 // 8
binary_array = binary_convert.to_bytes(byte_num, "big")
ascii = binary_array.decode()
print(ascii)
